    // }
  })


  return (
    <>
      <Navigation orientation={windowHeight > windowWidth} />
      <LandingPage orientation={windowHeight > windowWidth} />
      <AboutMe />
      <Projects />
      <ContactMe />
    </>
  );
}

export default App;
